// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

import "contracts/LogLibrary.sol";
import "contracts/proxy/ERC1967/ERC1967Utils.sol";
import "contracts/proxy/ERC1967/ProxyAdmin.sol";

/**
 * @title TransparentUpgradeableProxy
 * @dev This contract implements a transparent proxy pattern that forwards calls 
 * to an implementation (logic) contract. It allows for upgrading the logic contract 
 * and changing the admin, while ensuring storage layout consistency through custom 
 * storage slots as per EIP-1967.
 * 
 * Features:
 * 1. Fallback function forwards calls to the logic contract.
 * 2. Assembly-based handling of return data in fallback.
 * 3. Upgradable logic contract and adjustable admin permissions.
 * 4. Consistent storage layout using custom storage slots (ERC1967 standard).
 * 5. Initialization logic executed upon deployment or upgrades.
 */
contract TransparentUpgradeableProxy is ProxyAdmin {
    using LogLibrary for *;

    /// @dev Error thrown when a zero address is provided.
    error AddressEmptyError();

    /// @dev Emitted when a fallback call is forwarded to the logic contract.
    event FallbackLog(address indexed from, bytes4 indexed msgSig, bytes msgData);

    /// @dev Emitted when the logic contract is upgraded and initialization logic is executed.
    event UpgradeAndCallLog(address indexed logicAddress, bytes data, bool success, bytes resultData);

    /**
     * @dev Constructor that sets the initial logic contract and optionally initializes it.
     * @param _logicAddress The address of the initial logic contract.
     * @param data Initialization data encoded as bytes (e.g., abi.encodeWithSignature).
     */
    constructor(address _logicAddress, bytes memory data) ProxyAdmin(msg.sender) {
        _upgradeAndCall(_logicAddress, data);
    }

    /**
     * @dev Fallback function that forwards calls to the logic contract.
     * Emits a `FallbackLog` event and uses delegatecall to forward the request.
     */
    fallback() external payable {
        require(msg.sender != ERC1967Utils.getAdminAddress(), "fallback: admin can not access");
        emit FallbackLog(msg.sender, msg.sig, msg.data);
        // Forward the call to the logic contract
        ERC1967Utils.delegatecall();
    }

    /**
     * @dev Allows the contract to receive Ether without triggering fallback.
     */
    receive() external payable {}

    /**
     * @dev Allows the admin to upgrade the logic contract and optionally initialize it.
     * @param newLogicAddress The address of the new logic contract.
     * @param data Initialization data to be executed on the new logic contract.
     */
    function upgradeLogicAddress(address newLogicAddress, bytes memory data) external onlyAdmin {
        require(msg.sender == ERC1967Utils.getAdminAddress(), "upgradeLogicAddress: only admin can do");
        _upgradeAndCall(newLogicAddress, data);
    }

    /**
     * @dev Internal function to handle logic contract upgrades and optional initialization.
     * @param _address The address of the new logic contract.
     * @param data Initialization data to be executed after upgrading.
     */
    function _upgradeAndCall(address _address, bytes memory data) private {
        if (_address == address(0)) {
            revert AddressEmptyError();
        }

        // Update the logic contract address in storage
        ERC1967Utils.setImplementationAddress(_address);

        // Execute initialization logic if provided
        if (data.length > 0) {
            (bool success, bytes memory resultData) = _address.delegatecall(data);
            emit UpgradeAndCallLog(_address, data, success, resultData);
        }
    }

    /**
     * @dev Allows the admin to change the admin address.
     * @param _newAdmin The address of the new admin.
     */
    function changeAdmin(address _newAdmin) external onlyAdmin {
        super._changeAdmin(_newAdmin);
    }

    /**
     * @dev Retrieves the current admin address.
     * @return The address of the current admin.
     */
    function getAdmin() external view returns (address) {
        return ERC1967Utils.getAdminAddress();
    }
}

contracts/proxy/ERC1967/ProxyAdmin.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

import "contracts/proxy/ERC1967/ERC1967Utils.sol";

/**
 * @title ProxyAdmin
 * @dev This contract manages administrative control for an upgradeable proxy contract.
 * It handles admin permissions and allows the admin to change the admin address securely.
 */
contract ProxyAdmin {

    /**
     * @dev Custom error for unauthorized access attempts.
     * @param data A descriptive error message.
     */
    error NotAdminError(string data);

    /**
     * @dev Initializes the contract by setting the initial admin address.
     * The admin address is stored in the predefined ADMIN_SLOT from ERC1967Utils.
     * @param _adminAddress The address of the initial admin.
     */
    constructor(address _adminAddress) {
        ERC1967Utils.setAdminAddress(_adminAddress);
    }

    /**
     * @dev Modifier that restricts function access to the current admin only.
     * Reverts with a `NotAdminError` if the caller is not the admin.
     */
    modifier onlyAdmin() {
        if (msg.sender != ERC1967Utils.getAdminAddress()) {
            revert NotAdminError("Only admin can call this function");
        }
        _;
    }

    /**
     * @dev Changes the admin address to a new one.
     * Can only be called by the current admin.
     * @param _newAdmin The new admin address.
     */
    function _changeAdmin(address _newAdmin) internal onlyAdmin {
        ERC1967Utils.setAdminAddress(_newAdmin);
    }

    /**
     * @dev Retrieves the current admin address.
     * @return The address of the current admin.
     */
    function _getAdmin() internal view returns (address) {
        return ERC1967Utils.getAdminAddress();
    }
}

contracts/proxy/ERC1967/ERC1967Utils.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

/**
 * @title ERC1967Utils
 * @dev This library manages key storage slots for an ERC1967 proxy contract, including
 * the logic contract address (implementation) and the admin address.
 * It also provides low-level delegatecall functionality to delegate calls to the implementation contract.
 */
library ERC1967Utils {
    /**
     * @dev Custom storage slot structure to hold address type data.
     */
    struct AddressSlot {
        address value;
    }

    /**
     * @dev Storage slot for the current implementation (logic contract) address.
     * This slot is defined as keccak-256("eip1967.proxy.implementation") minus 1.
     * This is part of the EIP-1967 standard to avoid storage collisions.
     */
    bytes32 internal constant IMPLEMENTATION_SLOT = 0x360894a13ba1a3210667c828492db98dca3e2076cc3735a920a3ca505d382bbc;

    /**
     * @dev Retrieves the current implementation address stored in the IMPLEMENTATION_SLOT.
     * @return The address of the current implementation contract.
     */
    function getImplementationAddress() internal view returns(address) {
        return getAddressSlot(IMPLEMENTATION_SLOT).value;
    }

    /**
     * @dev Sets a new implementation address in the IMPLEMENTATION_SLOT.
     * @param _implementationAddress The new implementation contract address.
     */
    function setImplementationAddress(address _implementationAddress) internal {
        getAddressSlot(IMPLEMENTATION_SLOT).value = _implementationAddress;
    }

    /**
     * @dev Storage slot for the admin address of the contract.
     * This slot is defined as keccak-256("eip1967.proxy.admin") minus 1.
     * This is part of the EIP-1967 standard for secure admin address storage.
     */
    bytes32 internal constant ADMIN_SLOT = 0xb53127684a568b3173ae13b9f8a6016e243e63b6e8ee1178d6a717850b5d6103;

    /**
     * @dev Retrieves the current admin address stored in the ADMIN_SLOT.
     * @return The address of the current admin.
     */
    function getAdminAddress() internal view returns(address) {
        return getAddressSlot(ADMIN_SLOT).value;
    }

    /**
     * @dev Sets a new admin address in the ADMIN_SLOT.
     * @param _adminAddress The new admin address.
     */
    function setAdminAddress(address _adminAddress) internal {
        getAddressSlot(ADMIN_SLOT).value = _adminAddress;
    }

    /**
     * @dev Returns an AddressSlot struct that represents the address stored at the given slot.
     * This function uses inline assembly to access the specific storage slot.
     * @param slot The storage slot to access.
     * @return r An AddressSlot struct containing the address stored at the specified slot.
     */
    function getAddressSlot(bytes32 slot) internal pure returns (AddressSlot storage r) {
        assembly ("memory-safe") {
            r.slot := slot
        }
    }

    /**
     * @dev Delegates the current call to the implementation address stored in IMPLEMENTATION_SLOT.
     */
    function delegatecall() internal {
        _delegate(getImplementationAddress());
    }

    /**
     * @dev Low-level delegatecall implementation.
     * Delegates the current call to the provided implementation address.
     * @param implementation The address of the implementation contract to delegate the call to.
     */
    function _delegate(address implementation) private {
        assembly {
            // Copy call data to memory starting at position 0
            calldatacopy(0, 0, calldatasize())

            // Perform the delegatecall with the provided implementation address
            // gas() provides the remaining gas, calldatasize() provides input size
            // Output is stored at position 0, but size is unknown initially
            let result := delegatecall(gas(), implementation, 0, calldatasize(), 0, 0)

            // Copy returned data to memory
            returndatacopy(0, 0, returndatasize())

            // Check if the delegatecall was successful or not
            switch result
            case 0 {
                // If delegatecall failed, revert the transaction and return the error data
                revert(0, returndatasize())
            }
            default {
                // If delegatecall succeeded, return the data to the caller
                return(0, returndatasize())
            }
        }
    }

    /**
     * @dev Generates a storage slot based on the provided string.
     * This function computes the keccak256 hash of the string and subtracts 1 to match the EIP-1967 standard.
     * @param data The input string to generate the storage slot from.
     * @return The generated storage slot as a bytes32 value.
     */
    function generateStorageSlot(string memory data) public pure returns (bytes32) {
        return bytes32(uint256(keccak256(bytes(data))) - 1);
    }
}

contracts/LogLibrary.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;
library LogLibrary {
    // 定义日志打印事件
    event PrintUint256ArrayLog(string desc, uint256[] data);
    event PrintBoolLog(string desc, bool data);
    event PrintUint256Log(string desc, uint256 data);
    event PrintUint256KeyValueLog(string desc, uint256 key, uint256 value);
    event PrintAddressValueLog(string desc, address indexed key, uint256 value);
    event PrintStringLog(string desc, string value);
    event PrintAddressLog(string desc, address value);
    event PrintBytes32Log(string desc, bytes32 data);
    event PrintBytes32ArrayLog(string desc, bytes32[] data);
    event PrintLog(string desc);
    // 输出uint256[]日志
    function printUint256ArrayLog(string memory desc, uint256[] memory data) internal {
        emit PrintUint256ArrayLog(desc, data);
    }
    // 输出bool日志
    function printBoolLog(string memory desc, bool data) internal {
        emit PrintBoolLog(desc, data);
    }
    // 输出uint256日志
    function printUint256Log(string memory desc, uint256 data) internal {
        emit PrintUint256Log(desc, data);
    }
    // 输出uint256KeyValue日志
    function printUint256KeyValueLog(string memory desc, uint256 key, uint256 value) internal {
        emit PrintUint256KeyValueLog(desc, key, value);
    }
    function printAddressValueLog(string memory desc, address key, uint256 value) internal {
        emit PrintAddressValueLog(desc, key, value);
    }
    // 输出bytes日志
    function printBytesLog(string memory desc, bytes memory bytesLog) internal {
        emit PrintStringLog(desc, string(bytesLog));
    }
    // 输出string日志
    function printStringLog(string memory desc, string memory log) internal {
        emit PrintStringLog(desc, log);
    }
    // 输出address日志
    function printAddressLog(string memory desc, address data) internal {
        emit PrintAddressLog(desc, data);
    }
    function printBytes32Log(string memory desc, bytes32 data) internal {
        emit PrintBytes32Log(desc, data);
    }
    function printBytes32ArrayLog(string memory desc, bytes32[] memory data) internal {
        emit PrintBytes32ArrayLog(desc, data);
    }
    function printLog(string memory desc) internal {
        emit PrintLog(desc);
    }
}

